import React, { useEffect, useState }  from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Main from "./components/Main";
import Planets from "./components/Planets";
import Stars from "./components/Stars";
import Moon from "./components/Moon";
import Register from "./components/Register";
import About from "./components/About";
import PlanetPage from "./pages/PlanetPage";
import Forum from './components/Forum'
import ScrollProgressBar from "./components/ScrollProgressBar";
import TopicPage from "./components/TopicPage";
import "./style.css";
//npm start

function App() {
  const [isLargeFont, setIsLargeFont] = useState(false);

  // –§—É–Ω–∫—Ü—ñ—è –¥–ª—è –ø–µ—Ä–µ–º–∏–∫–∞–Ω–Ω—è —à—Ä–∏—Ñ—Ç–∞
  const toggleFontSize = () => {
    setIsLargeFont(!isLargeFont);
  };

  // –ó–±–µ—Ä—ñ–≥–∞—î–º–æ –≤–∏–±—ñ—Ä —à—Ä–∏—Ñ—Ç–∞ —É localStorage
  useEffect(() => {
    const savedFontSize = localStorage.getItem('fontSize');
    if (savedFontSize) {
      setIsLargeFont(savedFontSize === 'large');
    }
  }, []);

  useEffect(() => {
    if (isLargeFont) {
      document.body.classList.add('large-font');
      localStorage.setItem('fontSize', 'large');
    } else {
      document.body.classList.remove('large-font');
      localStorage.setItem('fontSize', 'normal');
    }
  }, [isLargeFont]);
  return (
    <Router>
      <div className="cosmos-back"></div>
      <div className="app-container">
        <ScrollProgressBar />
        <header>
          <h1>Solar System Project</h1>
          <nav className="nav-links">
            <Link to="/">Main</Link>
            <Link to="/planets">Planets</Link>
            <Link to="/stars">Stars</Link>
            <Link to="/moon">Moon</Link>
            <Link to="/register">Forum</Link>
            <Link to="/about">About</Link>
            <button className="contrast-toggle" onClick={toggleFontSize}>
              {isLargeFont ? 'üîç Smaller Text' : 'üîé Larger Text'}
            </button>
          </nav>
        </header>

        <div className="page-container">
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/planets" element={<Planets />} />
            <Route path="/planets/:planetName" element={<PlanetPage />} />
            <Route path="/stars" element={<Stars />} />
            <Route path="/moon" element={<Moon />} />
            <Route path="/forum" element={<Forum />} />
            <Route path="/register" element={<Register />} />
            <Route path="/about" element={<About />} />
            <Route path="/forum/topic/:id" element={<TopicPage />} />
          </Routes>
        </div>

        <div class = "bottom">
          <p>All rights reserved (C)</p>
        </div>
      </div>
    </Router>
  );
}

export default App;
